  vector<ll>v(n);
  cin(v);
  sort(allr(v));
  ll l=0,r=v[0],ans=v[0];
  for(int i=0;i<v.size();i++){
    sum+=v[i];
  }
  while(l<=r){
    ll mid=l+(r-l)/2;
